import React from "react";
import './index.css';
import Slider from "react-slick";


const HomeSlider =() => {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };
    return (
        <section className="homeSlider">
            <div className="container-fluid">
                <Slider {...settings}>
                    <div>
                        <h3>1</h3>
                    </div>
                    
                </Slider>
            </div>
        </section>
    )
}
export default HomeSlider;
